define([], function() { return "import * as React from 'react';\nimport {\n  Label,\n  Pivot,\n  PivotItem,\n  PivotLinkFormat\n} from '../../../../index';\n\nexport class PivotTabsExample extends React.Component<any, any> {\n  public render() {\n    return (\n      <div>\n        <Pivot linkFormat={ PivotLinkFormat.tabs }>\n            <PivotItem linkText='Foo'>\n              <Label>Pivot #1</Label>\n            </PivotItem>\n            <PivotItem linkText='Bar'>\n              <Label>Pivot #2</Label>\n            </PivotItem>\n            <PivotItem linkText='Bas'>\n              <Label>Pivot #3</Label>\n            </PivotItem>\n            <PivotItem linkText='Biz'>\n              <Label>Pivot #4</Label>\n            </PivotItem>\n        </Pivot>\n      </div>\n    );\n  }\n\n}\n"; });